import PropTypes from "prop-types";
import styles from "./GroupComponent.css";

const GroupComponent = ({ className = "" }) => {
  return (
    <header className={[styles.rectangleParent, className].join(" ")}>
      <div className={styles.frameChild} />
      <div className={styles.frameWrapper}>
        <div className={styles.frameParent}>
          <div className={styles.swasthyaLogoWrapper}>
            <img
              className={styles.swasthyaLogoIcon}
              loading="lazy"
              alt=""
              src="/swasthya-logo.svg"
            />
          </div>
          <nav className={styles.frameContainer}>
            <nav className={styles.homeParent}>
              <a className={styles.home}>Home</a>
              <a className={styles.services}>Services</a>
              <a className={styles.aboutUs}>About us</a>
              <a className={styles.faqs}>FAQS</a>
            </nav>
          </nav>
          <div className={styles.frameDiv}>
            <div className={styles.rectangleGroup}>
              <div className={styles.frameItem} />
              <a className={styles.emergencyCall}>Emergency Call</a>
              <a className={styles.space}>+91 99988 77777</a>
            </div>
          </div>
        </div>
      </div>
      <div className={styles.frameInner} />
    </header>
  );
};

GroupComponent.propTypes = {
  className: PropTypes.string,
};

export default GroupComponent;
